import Avatar from "./Avatar";

export default function Profile({ person, size }) {
  return (
    <Card>
      <h2>{person.name}</h2>
      <Avatar person={person} size={size} />
      <Recognitions recognitionList={person.recognitions} />
    </Card>
  );
}

function Card({ children }) {
  console.log(children);
  <section className="card">{children}</section>;
}

function Recognitions({ recognitionList }) {
  const itemList = recognitionList.map((item) => (
    <li>
      <b>{item.title.charAt(0).toUpperCase() + item.slice(1)}</b>
      {item.description}
    </li>
  ));
}

